import com.eviware.soapui.impl.wsdl.testcase.WsdlTestCase

def testCase = testRunner.testCase
def endpoints = ['http://mn-dev-haweb15.oldrepublictitle.com:8176', 'http://mn-dev-haweb16.oldrepublictitle.com:8177', 'http://mn-dev-haweb17.oldrepublictitle.com:8177']

for (endpoint in endpoints) {
    if (endpoint == null) {
        endpoint = 'http://mn-dev-haweb15.oldrepublictitle.com:8177'
    }
    testCase.setAmfEndpoint(endpoint)


       def testStep_User = testCase.testSteps['AgencyLookupService_Status_Dev']
    if (testStep_User != null) {
        testStep_User.setPropertyValue('Endpoint', endpoint)
        testStep_User.run(testRunner, context)
    } else {
        log.error("Test step 'AgencyLookupService_Status_Dev' not found")
    }

}

